import React from 'react';

const Home = () => {
    return (
        <>
        <div className="home-body">
           <div class="container">
                <div class="row">
                    <div class="col-md-12 text-center">
                        <h3 class="animate-charcter"> WELCOME!</h3>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}

export default Home;
